import React, {Component} from "react"
import './symbols.css'
import './style.css'
import './Desktop.js'
import './desktop.css'
import folder from './folder.jpg'

class Symbols extends Component {
  constructor(props) {
    super(props);
    this.title = this.title.bind(this);
    this.icon = this.icon.bind(this);
  }
  render() {
    return (
      <div id="each-icon">
        <img id="icons-pic" src={this.props.title} alt="imp"></img>
        <p id="icon-name">{this.props.icon}</p>
      </div>
    )
  }
}
export default Symbols;
